import React, { Component } from 'react'

export default class Events extends Component {
  render(props) {
    const tournamentName=this.props.tournamentName;
    const events=this.props.events;
    console.log("events are"+ events);
    let tot=0;
    const eventItems=events.map(eventItem => <div className={++tot}><p className="event">{eventItem.participant1} &nbsp {eventItem.participant2}</p></div>);
    return (
      <div>
        {eventItems}
      </div>
    )
  }
}
